INSERT INTO `Learning` (`Lid`, `Ltype`, `Lname`, `Ldetail`, `Ldirection`, `Lpic`, `Lurl`) VALUES
(1, 'Java', 'Java零基础学习', 'Java零基础学习视频\r\n适合Java 0基础，Java初学入门\r\n聊聊Java这条路该如何走，如何能够系统的学习这门编程语言', 4, 'https://i2.hdslb.com/bfs/archive/41575b1afec5305fa329d1cdf853373955d4e62a.jpg@570w_357h_100Q_1c.webp', 'https://www.bilibili.com/video/BV12J41137hu?spm_id_from=333.999.0.0'),
(2, 'Java', '网络编程', '什么是网络？何为网络协议？IP和端口是干嘛的？TCP和UDP协议、URL能干嘛？\r\n如何通过Java实现这一切，如何通过Java写聊天程序', 4, 'https://i0.hdslb.com/bfs/archive/f29aa0fccd25117c23bf2b356e4792fd993618d8.jpg@570w_357h_100Q_1c.webp', 'https://www.bilibili.com/video/BV1LJ411z7vY?spm_id_from=333.999.0.0'),
(3, 'Html', 'HTML5完整教学通俗易懂', 'HTML .\r\n从生活到代码，从简单到深入。\r\n源码级别讲解，风趣幽默,通俗易懂。', 3, 'https://i0.hdslb.com/bfs/archive/091f9d9d14de25ff9ef337576d9ee0a4d2b0088d.jpg@640w_400h_100Q_1c.webp', 'https://www.bilibili.com/video/BV1x4411V75C?spm_id_from=333.999.0.0'),
(4, 'JavaScriptJavaScript', 'JavaScriptJavaScript最新教程通俗易懂', '什么是JavaScript？基本语法是什么样？如何理解面向对象？\r\n操作BOM，操作DOM，jQuery怎么快速上手？\r\n趣味加实战，新特性补充讲解', 2, 'https://i2.hdslb.com/bfs/archive/238a41066a869db4d122d075317d38166678ab07.jpg@640w_400h_100Q_1c.webp', 'https://www.bilibili.com/video/BV1JJ41177di?spm_id_from=333.999.0.0'),
(5, 'Vue', 'Vue最新快速上手教程通俗易懂', 'vue基础、vue-cli、webpack、axios、npm、elementUI、vue-router、vuex；\r\n质量可能没有单独录制的高，尽量会用空闲时间给大家单独录制些高质量的视频。', 2, 'https://i0.hdslb.com/bfs/archive/83d143370b3052a1fb004e4977494997848a8564.jpg@640w_400h_100Q_1c.webp', 'https://www.bilibili.com/video/BV18E411a7mC?spm_id_from=333.999.0.0'),
(6, 'springboot', 'SpringBoot最新教程IDEA版通俗易懂', '从初识SpringBoot，然后进入web开发，原理探究，再到数据库连接，然后集成一些常用的框架，由易到难，层层递进，无论你是新手还是老手都能够有所收获', 2, 'https://i2.hdslb.com/bfs/archive/c9958e7a5a8553c1a93aa1787ef5847e06748650.jpg@640w_400h_100Q_1c.webp', 'https://i0.hdslb.com/bfs/archive/83d143370b3052a1fb004e4977494997848a8564.jpg@640w_400h_100Q_1c.webp'),
(7, 'Redis', 'Redis最新超详细版教程通俗易懂', '从Nosql聊起，深入redis基本类型使用，拓展特殊类型\r\n连接jedis，使用springboot集成，上手实战开发\r\n事务、配置文件详解、发布订阅、持久化机制、主从复制、哨兵模式、缓存穿透和雪崩处理\r\n给你带来最全面的Redis讲解，学Redis', 2, 'https://i2.hdslb.com/bfs/archive/ea566e372b8226ca1efff341d48ba6befca3ed66.jpg@640w_400h_100Q_1c.webp', 'https://www.bilibili.com/video/BV1S54y1R7SB?spm_id_from=333.999.0.0'),
(8, 'MyBatisPlus', 'MyBatisPlus最新完整教程通俗易懂', '深入浅出的讲解了MyBatisPlus使用的全流程以及实战教学', 3, 'https://i0.hdslb.com/bfs/archive/0c6023b66b1e9c048095e99886a424b999bc8246.jpg@640w_400h_100Q_1c.webp', 'https://www.bilibili.com/video/BV17E411N7KN?spm_id_from=333.999.0.0');
